import {useState, useEffect} from "react";


const Form = () => {
    const [kiosks, setKiosks] = useState(null)

          useEffect(() => {
            fetch('../data.json')
              .then(res => {
                return res.json();
              })
              .then(data => {
                setKiosks(data);
              })
          }, [])
        

    return ( 
        <h1>hi</h1>
     );
}
 
export default Form;
